import React, { useEffect, useState } from "react";
import axios from "axios";

const TestProjectLinks = () => {
  const [projects, setProjects] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchProjects = async () => {
      try {
        const BASE_API = process.env.REACT_APP_API_BASE_URL || "http://localhost:5000";
        const res = await axios.get(`${BASE_API}/api/project`);
        setProjects(res.data);
      } catch (err) {
        console.error("Error fetching projects:", err);
      } finally {
        setLoading(false);
      }
    };
    fetchProjects();
  }, []);

  if (loading) return <div>Loading projects...</div>;

  return (
    <div style={{ padding: "20px" }}>
      <h2>Project Links Test</h2>
      <ul>
        {projects.map((p) => {
          const BASE_FRONTEND = process.env.REACT_APP_FRONTEND_URL || "http://localhost:3000";
          const url = `${BASE_FRONTEND}/project/${p.slug}`;
          return (
            <li key={p.Project_ID} style={{ marginBottom: "10px" }}>
              <b>{p["Project Name"]}</b> -{" "}
              <a href={url} target="_blank" rel="noopener noreferrer">
                Open Project
              </a>
            </li>
          );
        })}
      </ul>
    </div>
  );
};

export default TestProjectLinks;
